import React from 'react'

export default function Skills() {
  return (
    <div className='Skillspor'>
     <div className="heading"><h1>My SKills</h1></div>
     <div className="mainskills">
      <div className="frontend"><h2>Front-End</h2></div>
      <div className="Backend"><h2>Back-end</h2></div>
      <div className="Others"><h2>Others</h2></div>
      </div>     
    </div>
  )
}
